import React, { Component } from 'react';
import { withRouter, Link } from 'react-router-dom';
import Navigation from './Navigation'

class RouterPage extends  Component{
    render() {
        return(
            <div>
                <Navigation />
                <Link><div className="boxes"><h4 className="box-text">FIRE</h4></div></Link>
                <Link><div className="boxes"><h4 className="box-text">FLOOD</h4></div></Link>
                <Link><div className="boxes"><h4 className="box-text">FAMINE</h4></div></Link>
                <Link><div className="boxes"><h4 className="box-text">HURRICANE</h4></div></Link>
                <div className="message">

                </div>
            </div>
        )
    }
}


export default withRouter(RouterPage);
